import React, { useState, useEffect } from 'react';
import {
  Container,
  Grid,
  Card,
  CardContent,
  Typography,
  TextField,
  Button,
  Box,
  CircularProgress,
  Alert,
  Chip,
  Stack,
} from '@mui/material';
import { Search, School, WorkHistory } from '@mui/icons-material';
import axios from 'axios';

const CandidateSearch = () => {
  const [candidates, setCandidates] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [filters, setFilters] = useState({
    search: '',
    skills: '',
    experience: ''
  });

  const fetchCandidates = async () => {
    setLoading(true);
    try {
      const response = await axios.get('/api/candidates/', {
        params: filters
      });
      setCandidates(response.data.results);
      setError(null);
    } catch (err) {
      setError('Failed to fetch candidates. Please try again later.');
      console.error('Error fetching candidates:', err);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchCandidates();
  }, []);

  const handleFilterChange = (event) => {
    const { name, value } = event.target;
    setFilters(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = (event) => {
    event.preventDefault();
    fetchCandidates();
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

      <Card sx={{ mb: 3 }}>
        <CardContent>
          <form onSubmit={handleSearch}>
            <Grid container spacing={2}>
              <Grid item xs={12} md={4}>
                <TextField
                  fullWidth
                  name="search"
                  label="Keywords"
                  value={filters.search}
                  onChange={handleFilterChange}
                  InputProps={{
                    startAdornment: <Search sx={{ mr: 1, color: 'text.secondary' }} />
                  }}
                />
              </Grid>
              <Grid item xs={12} md={4}>
                <TextField
                  fullWidth
                  name="skills"
                  label="Skills"
                  value={filters.skills}
                  onChange={handleFilterChange}
                  InputProps={{
                    startAdornment: <School sx={{ mr: 1, color: 'text.secondary' }} />
                  }}
                />
              </Grid>
              <Grid item xs={12} md={2}>
                <TextField
                  fullWidth
                  name="experience"
                  label="Min. Experience"
                  type="number"
                  value={filters.experience}
                  onChange={handleFilterChange}
                  InputProps={{
                    startAdornment: <WorkHistory sx={{ mr: 1, color: 'text.secondary' }} />
                  }}
                />
              </Grid>
              <Grid item xs={12} md={2}>
                <Button
                  fullWidth
                  variant="contained"
                  type="submit"
                  sx={{ height: '100%' }}
                >
                  Search
                </Button>
              </Grid>
            </Grid>
          </form>
        </CardContent>
      </Card>

      {loading ? (
        <Box display="flex" justifyContent="center" my={4}>
          <CircularProgress />
        </Box>
      ) : (
        <Grid container spacing={3}>
          {candidates.map((candidate) => (
            <Grid item xs={12} key={candidate.id}>
              <Card>
                <CardContent>
                  <Typography variant="h5" gutterBottom>
                    {candidate.name}
                  </Typography>
                  <Stack direction="row" spacing={1} mb={2}>
                    <Chip icon={<School />} label={candidate.education} />
                    <Chip icon={<WorkHistory />} label={`${candidate.experience} years`} />
                  </Stack>
                  <Box mb={2}>
                    <Typography variant="subtitle2" gutterBottom>Skills:</Typography>
                    <Stack direction="row" spacing={1} flexWrap="wrap">
                      {candidate.skills?.map((skill) => (
                        <Chip key={skill} label={skill} variant="outlined" size="small" />
                      ))}
                    </Stack>
                  </Box>
                  <Typography variant="body1" paragraph>
                    {candidate.summary}
                  </Typography>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                    <Typography variant="body2" color="text.secondary">
                      Last updated: {new Date(candidate.updated_at).toLocaleDateString()}
                    </Typography>
                    <Button
                      variant="contained"
                      href={`/candidates/${candidate.id}`}
                    >
                      View Profile
                    </Button>
                  </Box>
                </CardContent>
              </Card>
            </Grid>
          ))}
          {candidates.length === 0 && !loading && (
            <Grid item xs={12}>
              <Alert severity="info">No candidates found matching your criteria.</Alert>
            </Grid>
          )}
        </Grid>
      )}
    </Container>
  );
};

export default CandidateSearch;
